import React from 'react';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Translate from "../../Translate";
import InstarProducts from "../../containers/layouts/components/sidebar/sidemenu/icons";


export default function SelectForAllUi(props) {


    return (
        <FormControl
            style={{
                width: props.width,
                margin: props.margin,
            }}
        >
            <InputLabel id="demo-simple-select-label"><Translate name={props.label}/></InputLabel>
            <Select
                labelId="demo-simple-select-label"
                id="demo-simple-select"
                value={props.value}
                onChange={props.onChange}
            >
                {
                    props.data.map(
                        (item, index) => {
                            return (
                                <MenuItem
                                    key={index}
                                    value={item}
                                >
                                    <InstarProducts tag={item}/>
                                    {item}
                                </MenuItem>
                            )
                        }
                    )
                }
            </Select>
        </FormControl>

    );
}
